CREATE SCHEMA QNR_DB;
USE QNR_DB;

CREATE TABLE DEPT_LOCATIONS (
LOCID NUMERIC(2),
LOCNAME VARCHAR(50),
PRIMARY KEY (LOCID)    
);

CREATE TABLE DEPARTMENTS (
DEPTID NUMERIC(2),
DNAME VARCHAR(14),
LOCID NUMERIC(2),
PRIMARY KEY (DEPTID),
CONSTRAINT LOCID FOREIGN KEY (LOCID) REFERENCES DEPT_LOCATIONS(LOCID)
);

CREATE TABLE EMPLOYEES (
EMPID NUMERIC(4) NOT NULL,
LASTNAME VARCHAR(20),
FIRSTNAME VARCHAR(15),
JOB VARCHAR(9),
MNGID NUMERIC(4),
HIREDATE DATETIME,
SALARY NUMERIC(7,2),
COMM NUMERIC(7,2),
DEPTID NUMERIC(2),
PRIMARY KEY (EMPID),
CONSTRAINT MNGID_EMPID FOREIGN KEY (MNGID) REFERENCES EMPLOYEES(EMPID),
CONSTRAINT DEPTID FOREIGN KEY (DEPTID) REFERENCES DEPARTMENTS(DEPTID)
);

create user 'admin'@'localhost' identified by 'admin';

Grant all privileges 
on QNR_DB.*
to 'admin'@'localhost';

